import React from 'react';
//import logo
import Logo from '../img/Logo.png';

const Footer = () => {
  return (
    <footer>
        <img src={Logo} alt="" />
        <span>Made with love and <b>React.js</b>.</span>
    </footer>
  )
}

export default Footer
